import { Box, Modal } from '@material-ui/core';
import PropTypes from 'prop-types';

interface PropsResendCode {
    open: boolean, 
    handleClose: () => void, 
    phone: number
}
export const PopUpResendCode: React.FC<PropsResendCode> = ({ open, handleClose, phone }) => {
    return (
        <Modal
            open={open}
            onClose={handleClose}
        >
            <Box>
                <p>A code has been sent to {phone} via SMS</p>
            </Box>
        </Modal>
    )
}

PopUpResendCode.propTypes = {
    open: PropTypes.bool,
    handleClose: PropTypes.bool,
    phone: PropTypes.number
}
